import React from 'react'
import { useState } from 'react'
const BookSearch = ({functionSearchParent}) => {
    const [title, setTitle] = useState('')
    const [des, setDes] = useState('')
    const handlChangeTitle = (e) => {
        setTitle(e.target.value);
      }
      const handlChangeDes = (e) => {
        setDes(e.target.value);
      }
      const handleSubmit = (e) => {
        e.preventDefault();
        functionSearchParent(title);
        functionSearchParent(des);
    }
  return (
    <div>
        <form onSubmit={handleSubmit}>
        <input onChange={handlChangeTitle} type="text" value={title} />
        <input onChange={handlChangeDes} type="text" value={des} />
        <input type="Checkbox" name="" id="" />
    </form>
    </div>
  )
}

export default BookSearch
